import osimport torchfrom torchvision.models import resnet34model = resnet34(pretrained=True)model.eval()example_input = torch.randn(1, 3, 224, 224)traced_model = torch.jit.trace(model, example_input)try:    traced_model.save('./model_store/resnet34.pt')except RuntimeError:    os.mkdir('model-store')    traced_model.save('./model_store/resnet34.pt')except Exception as e:    print(e)